let data=[]

const cartReducer=(state=dataaction)=>{
        switch(action.type){
            case "NEW_DATA":
                return [...state,action.payload]
                case "API_DATA":
                    return [...state,action.payload]
                    default:
                   return state
        }
}

export default cartReducer
